import React, { useState, useEffect } from 'react';
import { getTenants, addTenant, updateTenant, deleteTenant } from '../api.js';
import AddFormModal from './AddFormModal.jsx'; // Corrected import
import '../app.css';

const Tenants = ({ currentTheme, searchQuery }) => {
  const [tenants, setTenants] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [currentTenant, setCurrentTenant] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchTenants();
  }, []);

  const fetchTenants = async () => {
    setLoading(true);
    try {
      const data = await getTenants();
      setTenants(data);
      setError(null);
    } catch (err) {
      setError("Failed to fetch tenants. Please try again.");
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleAdd = async (newTenant) => {
    try {
      await addTenant(newTenant);
      fetchTenants();
      setIsModalOpen(false);
    } catch (err) {
      setError("Failed to add tenant. Please check the data and try again.");
      console.error(err);
    }
  };

  const handleEdit = async (id, updatedTenant) => {
    try {
      await updateTenant(id, updatedTenant);
      fetchTenants();
      setIsModalOpen(false);
    } catch (err) {
      setError("Failed to update tenant. Please try again.");
      console.error(err);
    }
  };

  const handleDelete = async (id) => {
    try {
      await deleteTenant(id);
      fetchTenants();
    } catch (err) {
      setError("Failed to delete tenant. Please try again.");
      console.error(err);
    }
  };

  const handleOpenModal = (tenant = null) => {
    setCurrentTenant(tenant);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
    setCurrentTenant(null);
  };

  const filteredTenants = tenants.filter(tenant =>
    tenant.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
    tenant.email.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div style={{ padding: '2rem', backgroundColor: currentTheme.background, color: currentTheme.text }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '2rem' }}>
        <h1 style={{ margin: 0 }}>Tenants</h1>
        <button
          onClick={() => handleOpenModal()}
          style={{
            backgroundColor: currentTheme.primary,
            color: 'white',
            border: 'none',
            padding: '0.75rem 1.5rem',
            borderRadius: '8px',
            cursor: 'pointer',
          }}
        >
          Add Tenant
        </button>
      </div>

      {loading && <p>Loading tenants...</p>}
      {error && <p style={{ color: 'red' }}>{error}</p>}

      {!loading && !error && (
        <div style={{ overflowX: 'auto', backgroundColor: currentTheme.card, borderRadius: '8px', boxShadow: '0 2px 10px rgba(0,0,0,0.05)' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ backgroundColor: currentTheme.background }}>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Name</th>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Email</th>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Phone</th>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Unit</th>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Status</th>
                <th style={{ padding: '1rem', textAlign: 'left', color: currentTheme.text }}>Actions</th>
              </tr>
            </thead>
            <tbody>
              {filteredTenants.map((tenant) => (
                <tr key={tenant.id} style={{ borderBottom: `1px solid ${currentTheme.border}` }}>
                  <td style={{ padding: '1rem' }}>{tenant.name}</td>
                  <td style={{ padding: '1rem' }}>{tenant.email}</td>
                  <td style={{ padding: '1rem' }}>{tenant.phone_number}</td>
                  <td style={{ padding: '1rem' }}>{tenant.unit_id}</td>
                  <td style={{ padding: '1rem' }}>{tenant.status}</td>
                  <td style={{ padding: '1rem' }}>
                    <button
                      onClick={() => handleOpenModal(tenant)}
                      style={{ background: 'none', border: 'none', color: currentTheme.primary, cursor: 'pointer' }}
                    >
                      Edit
                    </button>
                    <button
                      onClick={() => handleDelete(tenant.id)}
                      style={{ background: 'none', border: 'none', color: '#dc3545', cursor: 'pointer', marginLeft: '0.5rem' }}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {isModalOpen && (
        <AddFormModal
          isOpen={isModalOpen}
          onClose={handleCloseModal}
          onSubmit={currentTenant ? handleEdit : handleAdd}
          initialData={currentTenant}
          currentTheme={currentTheme}
        />
      )}
    </div>
  );
};

export default Tenants;
